import styled from 'styled-components';
import { useState } from 'react';
import {
  PageWrapper,
  PageTitle,
  StyledForm,
} from '../../../components/shared/CommonStyles';

export default function Signup() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [address, setAddress] = useState('');
  const [telephoneNum, setTelephoneNum] = useState(''); // TO-DO validacao num telefone
  const [password, setPassword] = useState('');
  const [isLoading, setIsLoading] = useState(false);

  function submitInput(e) {
    e.preventDefault();
    console.log(name, email, password, address, telephoneNum);
  }

  return (
    <PageWrapper>
      <SignupWrapper>
        <PageTitle>Cadastrar novo Posto de Saúde</PageTitle>

        <StyledForm onSubmit={submitInput}>
          <label htmlFor="name">Nome: </label>
          <input
            type="name"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
          />

          <label htmlFor="email">E-mail: </label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />

          <label htmlFor="address">Endereço: </label>
          <input
            type="text"
            id="address"
            value={address}
            onChange={(e) => setAddress(e.target.value)}
            required
          />

          <label htmlFor="password">Senha: </label>
          <input
            type="text"
            id="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />

          <label htmlFor="telephone">Telefone : </label>
          <input
            type="tel"
            pattern="[0-9]{2} [0-9]{5}-[0-9]{4}"
            id="telephone"
            placeholder="11 99999-8888"
            value={telephoneNum}
            onChange={(e) => setTelephoneNum(e.target.value)}
            required
          />

          <input type="submit" disabled={isLoading} value="Cadastrar" />
        </StyledForm>
      </SignupWrapper>
    </PageWrapper>
  );
}

const SignupWrapper = styled.div`
  width: 800px;
  @media screen and(max-width:800px) {
    max-width: 100vw;
  }
`;
